//random function stuff
function MUL(x,y){
	return(x*y);
}
function P1(x,y){
	return(x);
}
function P2(x,y){
	return(y)
}
function SINPI(x,y){
	return(Math.sin(x*Math.PI));
}
function COSPI(x,y){
	return(Math.cos(x*Math.PI));
}
function SIN2PI(x,y){
	return(Math.sin(2*x*Math.PI));
}
function COS2PI(x,y){
	return(Math.cos(2*x*Math.PI));
}
function SIN3PI(x,y){
	return(Math.sin(3*x*Math.PI));
}
function COS3PI(x,y){
	return(Math.cos(3*x*Math.PI));
}
function CUBE(x,y){
	return(x*x*x);
}
function SINXXYY(x,y){
	return(Math.sin(Math.PI*(x*x+y*y)));
}
function SINXXXYYY(x,y){
	return(Math.sin(Math.PI*(x*x*x+y*y*y)));
}
function SQUARE(x,y){
	return(x*x);
}
function AVG(x,y){
	return((x+y)/2);
}
function MIN(x,y){
	if (x<y) return(x);
	else return(y);
}
function MAX(x,y){
	if (x>y) return(x);
	else return(y);
}
function ADD(x,y){
	return((x+y+2)%2-1);
}
function DIFFSQUARE(x,y){
	return((x*x-y*y+2)%2-1)
}
function MYRANDOM(){
	var s=THESEED;
	var RNGMOD=Math.pow(2,16);
	var a=4*37+1;
	var c=11111;
	THESEED=(s*a + c)%RNGMOD;
	return(THESEED/RNGMOD);
}
function NOISE(x,y){
	var s=this.constants.RNGSEED;
	var RNGMOD=Math.pow(2,16);
	var a=4*37+1;
	var c=11111;
	var w=3;
	x=Math.abs(x*(w-1));
	y=Math.abs(y*(w-1));
	var X=Math.floor(x);
	var Y=Math.floor(y);
	var sx=x-X;
	var sy=y-Y;
	sx=3*sx*sx-2*sx*sx*sx;
	sy=3*sy*sy-2*sy*sy*sy;
	var i=0;
	while (i<X+w*Y) {
		s=(s*a + c)%RNGMOD;
		i++;
	}
	var TL=s/RNGMOD;
	s=(s*a + c)%RNGMOD;
	i++;
	var TR=s/RNGMOD;
	while (i<X+w*(Y+1)){
		s=(s*a + c)%RNGMOD;
		i++;
	}
	var BL=s/RNGMOD;
	s=(s*a + c)%RNGMOD;
	var BR=s/RNGMOD;
	var r=(1-sy)*((1-sx)*TL+sx*TR)+sy*((1-sx)*BL+sx*BR);
	return((2*r-1));
}
var theFunctions=['P1','P2','MUL', 'SINPI', 'COSPI','CUBE','SINXXYY','MAX','MIN','SIN2PI','COS2PI','AVG','NOISE'];
function lerp(a,b,t){
	return(t*b+(1-t)*a);
}

function randomFunction(n){
	var r,s,t,u;
	if (n==1){
		if (MYRANDOM()<0.5)
			r='x';//r='P1(x,y)'
		else
			r='y';//r='P2(x,y)';
	}
	else{
		s=randomFunction(n-1);
		t=randomFunction(n-1);
		u=theFunctions[Math.floor(theFunctions.length*MYRANDOM())];
		if (u=='P1')
			r=s;
		else if (u=='P2')
			r=t;
		else	
			r=u+'('+s+','+t+')';
	}
	return(r);
}
